import React from 'react';
import App from './App'

function Login() {

    this.setState({
        username: "",
        password: ""
    });

    const handleUsername = (e) => {
        const username = e.target.value;
        this.setState({ username });
    }

    const handlePassword = (e) => {
        const password = e.target.value;
        this.setState({ password });
    }

    return (
        <React.Fragment>
            <App active="login"/>
            <div className="content" style={{ height: "calc(100vh - 56px)", flexDirection: "column", display: "flex", justifyContent: "center", alignItems: "center"}}>
                <div>
                    <input type="text" onChange = {handleUsername} placeholder="Username" />
                </div>
                <div>
                    <input type="password" onChange = {handlePassword} placeholder="Password" />
                </div>
                <div style={{width: "258px"}}>
                    <button>Login</button>
                </div>
            </div>
        </React.Fragment>
    );
}

export default Login;
